ame="c3122642"></a><div class="c1"><div class="c2"><div class="c3">Posted on 02 October 2019, 21:29 by: &nbsp; <a href="https://e-hentai.org/uploader/Eatball">Eatball</a>&nbsp; &nbsp; <a href="https://forums.e-hentai.org/index.php?showuser=1843521"><img class="ygm" src="https://ehgt.org/g/ygm.png" alt="PM" title="Contact Poster"></a></div><div class="c4 nosel">[<a id="comment_vote_up_3122642" style="" href="#" onclick="vote_comment_up(3122642); this.blur(); return false">Vote+</a>] &nbsp; [<a id="comment_vote_down_3122642" style="" href="#" onclick="vote_comment_down(3122642); this.blur(); return false">Vote-</a>]</div><div class="c5 nosel" onmouseover="document.getElementById('cvotes_3122642').style.display=''" onclick="this.onmouseover(); this.onmouseout=undefined" onmouseout="document.getElementById('cvotes_3122642').style.display='none'">Score <span id="comment_score_3122642" style="opacity:1.0">+161</span></div><div class="c"></div></div><div class="c6" id="comment_3122642">很推荐游玩并入正（虽然国庆期间梯子不行了）这款游戏，cg、游戏系统、剧本都是批评空间80+的水准，我打分的话估计批评空间基准83～84（至少80+），属于一旦玩上就不可能中途停下睡觉的那种。<br>整体来说是解密向的感动作品，含一些黑化和恐怖（暗红墙壁上贴满血眼睛那种），但最多让你ぞくぞくする的程度。（现在看到的黑化cg被混在了超拔的cg中所以对jj伤害大，但实际玩起来这些cg毫无恐怖感，甚至有点搞笑。这游戏里最恐怖的也就是走廊里贴满血眼睛了。）<br>最后说一下，这款游戏剧本几乎找不出大的缺点，cg水准也是有目共睹的一流水平（一周不缺おかず），还有emote功能和立绘编辑功能，实属名作之种子，完全是地雷的反义词。以及但凡有一点想玩这游戏的念头，请不要看cg包剧透，只依靠官方“剧透”来进行解密是最好的。<br><br>最后一句话解释剧情&amp;黑化CG：男主和粉毛淫魔一边H一边将四个受诅咒（被诅咒后就会黑化图那样）的少女解救出来。真结局就一个，哪里失败的话会进bad结局。</div><div class="c7" id="cvotes_3122642" style="display:none">Base +6, <span>幻天醬 +7</span>, <span>evodark +6</span>, <span>dengdengdong +1</span>, <span>ABCCBDADE +6</span>, <span>test2233 +4</span>, <span>Tomas John +4</span>, <span>facegayrat +5</span>, <span>BeatingStorm +9</span>, <span>spicalight +11</span>, <span>190151292Leung +6</span>, <span>rainivy +6</span>, <span>lyyyyyy1 +17</span>, and 10 more...</div></div><a name="c3126171"></a><div class="c1"><div class="c2"><div class="c3">Posted on 04 October 2019, 18:18 by: &nbsp; <a href="https://e-hen